import*as d3 from"https://cdn.jsdelivr.net/npm/d3@7/+esm";let canvas=d3.select(".canva"),svg=canvas.append("svg").attr("height",400).attr("width",400),rect=svg.selectAll("rect");d3.json("test.json").then(t=>{rect.data(t).enter().append("rect").attr("width",(t,e)=>t.width).attr("height",(t,e)=>t.height).attr("fill",t=>t.fill).attr("x",(t,e)=>26*e)});